searchNodes=[{"doc":"Provides methods for passing the PTR course.","ref":"Ptrlabs.html","title":"Ptrlabs","type":"module"},{"doc":"","ref":"Ptrlabs.html#arrangements/2","title":"Ptrlabs.arrangements/2","type":"function"},{"doc":"","ref":"Ptrlabs.html#comb/3","title":"Ptrlabs.comb/3","type":"function"},{"doc":"Returns the longest common prefix from a given list of strings Examples iex&gt; Ptrlabs . commonPrefix ( [ &quot;alpha&quot; , &quot;beta&quot; , &quot;gamma&quot; ] ) &quot;&quot; iex&gt; Ptrlabs . commonPrefix ( [ &quot;flower&quot; , &quot;flow&quot; , &quot;flight&quot; ] ) &quot;fl&quot;","ref":"Ptrlabs.html#commonPrefix/1","title":"Ptrlabs.commonPrefix/1","type":"function"},{"doc":"Returns the area of a cylinder given the radius and the height Examples iex&gt; Ptrlabs . cylinderArea ( 3 , 4 ) 175.92904","ref":"Ptrlabs.html#cylinderArea/2","title":"Ptrlabs.cylinderArea/2","type":"function"},{"doc":"Returns the plaintext of a caesar cipher encoding given a ciphertext and a key.Works with upper and lower case. Examples iex&gt; Ptrlabs . decode ( &quot;oRuHp&quot; , 3 ) &quot;lOrEm&quot; iex&gt; Ptrlabs . decode ( &quot;oruhp&quot; , 3 ) &quot;lorem&quot;","ref":"Ptrlabs.html#decode/2","title":"Ptrlabs.decode/2","type":"function"},{"doc":"Returns the ciphertext of a caesar cipher encoding given a plaintext and a key.Works with upper and lower case. Examples iex&gt; Ptrlabs . encode ( &quot;lorem&quot; , 3 ) &quot;oruhp&quot; iex&gt; Ptrlabs . encode ( &quot;lOrEm&quot; , 3 ) &quot;oRuHp&quot;","ref":"Ptrlabs.html#encode/2","title":"Ptrlabs.encode/2","type":"function"},{"doc":"Returns a list of n elements randomly selected from a given list Examples iex&gt; test = Ptrlabs . extractRandomN ( [ 1 , 2 , 3 , 4 , 8 , 4 ] , 3 ) iex&gt; length ( test ) == 3 &amp;&amp; MapSet . subset? ( MapSet . new ( test ) , MapSet . new ( [ 1 , 2 , 3 , 4 , 8 , 4 ] ) ) true","ref":"Ptrlabs.html#extractRandomN/2","title":"Ptrlabs.extractRandomN/2","type":"function"},{"doc":"","ref":"Ptrlabs.html#factorial/1","title":"Ptrlabs.factorial/1","type":"function"},{"doc":"Returns the prime factors of a given number Examples iex&gt; Ptrlabs . factorize ( 42 ) [ 2 , 3 , 7 ]","ref":"Ptrlabs.html#factorize/1","title":"Ptrlabs.factorize/1","type":"function"},{"doc":"","ref":"Ptrlabs.html#factorize/2","title":"Ptrlabs.factorize/2","type":"function"},{"doc":"","ref":"Ptrlabs.html#factors/1","title":"Ptrlabs.factors/1","type":"function"},{"doc":"","ref":"Ptrlabs.html#fib/2","title":"Ptrlabs.fib/2","type":"function"},{"doc":"Return n fibonacci numbers,starting from 1 Examples iex&gt; Ptrlabs . firstFibonacciElements ( 7 ) [ 1 , 1 , 2 , 3 , 5 , 8 , 13 ]","ref":"Ptrlabs.html#firstFibonacciElements/1","title":"Ptrlabs.firstFibonacciElements/1","type":"function"},{"doc":"","ref":"Ptrlabs.html#getCase/1","title":"Ptrlabs.getCase/1","type":"function"},{"doc":"Returns an honest greeting. Examples iex&gt; Ptrlabs . greetPTR &quot;hello PTR&quot;","ref":"Ptrlabs.html#greetPTR/0","title":"Ptrlabs.greetPTR/0","type":"function"},{"doc":"Given an array of strings, returns a map with the grouped anagrams Examples iex&gt; Ptrlabs . groupAnagrams ( [ &quot;eat&quot; , &quot;tea&quot; , &quot;tan&quot; , &quot;ate&quot; , &quot;nat&quot; , &quot;bat&quot; ] ) %{ &quot;abt&quot; =&gt; [ &quot;bat&quot; ] , &quot;aet&quot; =&gt; [ &quot;eat&quot; , &quot;tea&quot; , &quot;ate&quot; ] , &quot;ant&quot; =&gt; [ &quot;tan&quot; , &quot;nat&quot; ] }","ref":"Ptrlabs.html#groupAnagrams/1","title":"Ptrlabs.groupAnagrams/1","type":"function"},{"doc":"Given a string of digits from 2 to 9 returns all possible letter combinations that the number could represent Examples iex&gt; Ptrlabs . letterCombination ( &quot;23&quot; ) [ &quot;ad&quot; , &quot;ae&quot; , &quot;af&quot; , &quot;bd&quot; , &quot;be&quot; , &quot;bf&quot; , &quot;cd&quot; , &quot;ce&quot; , &quot;cf&quot; ]","ref":"Ptrlabs.html#letterCombination/1","title":"Ptrlabs.letterCombination/1","type":"function"},{"doc":"Given a list of strings returns the ones that could be written using only the buttons from one row of a qwerty keyboard Examples iex&gt; Ptrlabs . lineWords ( [ &quot;hello&quot; , &quot;alaska&quot; , &quot;dad&quot; , &quot;peace&quot; ] ) [ &quot;alaska&quot; , &quot;dad&quot; ]","ref":"Ptrlabs.html#lineWords/1","title":"Ptrlabs.lineWords/1","type":"function"},{"doc":"Returns a list of all the possible values for the lengths of the sides of a valid right angled triangle, where the length of the base and the perpendicular can't exceed 20.","ref":"Ptrlabs.html#listRightAngleTriangles/0","title":"Ptrlabs.listRightAngleTriangles/0","type":"function"},{"doc":"","ref":"Ptrlabs.html#magic/2","title":"Ptrlabs.magic/2","type":"function"},{"doc":"Checks if a given number is prime Examples iex&gt; Ptrlabs . prime? ( 3 ) true","ref":"Ptrlabs.html#prime?/1","title":"Ptrlabs.prime?/1","type":"function"},{"doc":"Returns a given list without consecutive duplicates Examples iex&gt; Ptrlabs . removeConsecutiveDuplicates ( [ 1 , 2 , 2 , 2 , 4 , 8 , 4 ] ) [ 1 , 2 , 4 , 8 , 4 ]","ref":"Ptrlabs.html#removeConsecutiveDuplicates/1","title":"Ptrlabs.removeConsecutiveDuplicates/1","type":"function"},{"doc":"Returns the reverse of a given list Examples iex&gt; Ptrlabs . reverse ( [ 1 , 2 , 3 ] ) [ 3 , 2 , 1 ]","ref":"Ptrlabs.html#reverse/1","title":"Ptrlabs.reverse/1","type":"function"},{"doc":"Rotates a given list count number of places and returns it. Examples iex&gt; Ptrlabs . rotateLeft ( [ 1 , 2 , 4 , 8 , 4 ] , 3 ) [ 8 , 4 , 1 , 2 , 4 ] iex&gt; Ptrlabs . rotateLeft ( [ 1 , 2 , 4 , 8 , 4 ] , 5 ) [ 1 , 2 , 4 , 8 , 4 ] iex&gt; Ptrlabs . rotateLeft ( [ 1 , 2 , 4 , 8 , 4 ] , 101 ) [ 2 , 4 , 8 , 4 , 1 ]","ref":"Ptrlabs.html#rotateLeft/2","title":"Ptrlabs.rotateLeft/2","type":"function"},{"doc":"","ref":"Ptrlabs.html#shift/3","title":"Ptrlabs.shift/3","type":"function"},{"doc":"Given a list of numbers returns the smallest number that can be obtained by arranging the numbers. A number can't start with a 0 Examples iex&gt; Ptrlabs . smallestNumber ( [ 3 , 2 , 1 ] ) 123 iex&gt; Ptrlabs . smallestNumber ( [ 0 , 5 , 1 ] ) 105 iex&gt; Ptrlabs . smallestNumber ( [ ] ) &quot;Can&#39;t be empty&quot;","ref":"Ptrlabs.html#smallestNumber/1","title":"Ptrlabs.smallestNumber/1","type":"function"},{"doc":"Given a dictionary and a string returns a string containing the translated version of all the words that matched. A word is considered a substring that is followed by a ' ' character. If the first argument is not a map the default dictionary will be used stored in the module as @dictionary. Examples iex&gt; Ptrlabs . translator ( 1 , &quot;mama is with papa&quot; ) &quot;mother is with father&quot;","ref":"Ptrlabs.html#translator/2","title":"Ptrlabs.translator/2","type":"function"},{"doc":"Returns the sum of unique elements of a given list Examples iex&gt; Ptrlabs . uniqueSum ( [ 1 , 2 , 4 , 8 , 4 , 2 ] ) 15","ref":"Ptrlabs.html#uniqueSum/1","title":"Ptrlabs.uniqueSum/1","type":"function"}]